(\\\\displaystyle \\\\frac {13}{4}\\\\) as a mixed number.</p>\\n\\n<p>The improper fraction \\\\(\\\\displaystyle \\\\frac {13}{4}\\\\) stands for \\\\(13\\\\) divided by \\\\(4\\\\).<br />\\n </p>\\n\"},\"subContentId\":\"19a74a40-5053-42cd-8ffa-51b67723101c\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.2600806451612903,\"y\":75.8704512045682,\"width\":75.60483870967742,\"height\":24.129623667587595,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Therefore, \\\\(\\\\displaystyle \\\\frac{13}{4} = \\\\) \\\\(3\\\\) wholes \\\\(+\\\\displaystyle\\\\frac{1}{4} \\\\) = \\\\(3\\\\displaystyle \\\\frac{1}{4} \\\\).</p>\\n\\n<p><strong>Example 2: </strong>\\\\(\\\\displaystyle\\\\frac{11}{5} = 2\\\\displaystyle\\\\frac{1}{5}\\\\), since when we divide \\\\(11\\\\) by \\\\(5\\\\), we get: \\\\(11 = (5\\\\times 2) + 1\\\\).<br />\\n </p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"fc4d38a0-e81f-4c0e-977a-79a481cd0de1\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":46.622983870967744,\"y\":17.470169685262416,\"width\":46.17565524193548,\"height\":39.93181642345695,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQEAYABgAAD/4QAiRXhpZgAATU0AKgAAAAgAAQESAAMAAAABAAEAAAAAAAD/2wBDAAIBAQIBAQICAgICAgICAwUDAwMDAwYEBAMFBwYHBwcGBwcICQsJCAgKCAcHCg0KCgsMDAwMBwkODw0MDgsMDAz/2wBDAQICAgMDAwYDAwYMCAcIDAwMDAwMDAwMDAwMDAwMDA :63.15153210127702,\"width\":52.381180125213795,\"height\":9.981460514504555,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>\\\\(\\\\underline{\\\\textbf{2}^{\\\\textbf{nd}} \\\\textbf{ Method}}\\\\)<strong>: Use Multiplication and Addition</strong></p>\\n\\n<p> </p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a14039b1-8f01-4e4e-a74c-fd7ddcfd7921\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":0,\"y\":0,\"width\":100,\"height\":7.901661192571385,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3 style=\\\"text-align:center\\\"><span style=\\\"color:#0086ff\\\"><strong>How to Compare Mixed Numbers</strong></span></h3>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"115af822-d69b-4fd6-a102-9aad09c3ca4f\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.2600806451612903,\"y\":12.478692632330295,\"width\":47.88306451612903,\"height\":67.3849402145836,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>To compare two mixed numbers, first we compare the whole parts and then the fractional parts.</p>\\n\\n<ul>\\n\\t<li>If the whole parts are different, then the mixed number with the greater whole number is larger.<br />\\n\\t<strong>Examples: </strong>\\\\(7\\\\displaystyle\\\\frac{1}{3}\\\\)  \\\\(&gt;\\\\)  \\\\(5\\\\displaystyle\\\\frac{1}{2} \\\\)    ;    \\\\(4\\\\displaystyle\\\\frac{5}{9}\\\\)  \\\\(&lt;\\\\)  \\\\(6\\\\)</li>\\n\\t<li>If the whole parts are the same, then we compare the fractions. The one with the greater fractional part is larger.<br />\\n\\t<strong>Examples:</strong> \\\\(4\\\\displaystyle\\\\frac{1}{5}\\\\)  \\\\(&lt;\\\\)  \\\\(4\\\\displaystyle\\\\frac{3}{5} \\\\)    ;    \\\\(5\\\\displaystyle\\\\frac{1}{2}\\\\)  \\\\(&gt;\\\\)  \\\\(5\\\\displaystyle\\\\frac{1}{3} \\\\)</li>\\n</ul>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9f8315b0-5591-40cd-a16f-90ae173f26fe\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":52.92338709677419,\"y\":11.979544927037084,\"width\":45.36290322580645,\"height\":29.94886231759271,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>To compare a mixed number to an improper fraction, make sure to change either one so that both numbers are in the same form.<br />\\n<br />\\n<strong>Example: </strong>Compare \\\\(4\\\\displaystyle\\\\frac{5}{6}\\\\) to \\\\(\\\\displaystyle\\\\frac{25}{6} \\\\).</p>\\n\\n<p> </p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"7a6b1cc1-405f-487c-9b8f-c97bf428de4f\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":50.529233870967744,\"y\":12.478692632330297,\"width\":0.3129196068548387,\"height\":84.85510989984601,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"line\":{\"borderWidth\":\"2\",\"borderStyle\":\"solid\",\"borderColor\":\"rgb(77, 91, 169)\"},\"type\":\"vertical-line\",\"shape\":{\"fillColor\":\"#ffffff\",\"borderColor\":\"#000000\",\"borderWidth\":\"0\",\"borderStyle\":\"solid\",\"borderRadius\":\"0\"}},\"subContentId\":\"c0f8f9c1-f99e-4c54-bc00-7a4f717c382f\",\"metadata\":
